import Layout from "../../components/layout";
import { useRouter } from "next/router";

const Adresse = () => {
	const router = useRouter();
	const { leistung } = router.query;
	return (
		<Layout>
			<h1>{leistung}</h1>
		</Layout>
	);
};

export default Adresse;
